// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "OpenZeppelin/openzeppelin-contracts@5.0.2/contracts/token/ERC20/ERC20.sol";
import "OpenZeppelin/openzeppelin-contracts@5.0.2/contracts/access/Ownable.sol";
import "Uniswap/v2-periphery@1.0.0-beta.0/contracts/interfaces/IUniswapV2Router02.sol";
import "Uniswap/v2-core@1.0.1/v2-core/contracts/interfaces/IUniswapV2Factory.sol";
import "Uniswap/v2-core@1.0.1/v2-core/contracts/interfaces/IUniswapV2Pair.sol";

interface IWMATIC {
    function deposit() external payable;
    function withdraw(uint wad) external;
    function transfer(address dst, uint wad) external returns (bool);
}

contract CalFundToken is ERC20, Ownable {
    IUniswapV2Router02 public uniswapRouter;
    IUniswapV2Factory public uniswapFactory;
    IUniswapV2Pair public uniswapPair;
    IWMATIC public wmatic;
    address public maticAddress;
    address public proposedNewCommissionAddress;
    uint256 public proposalEndTime;

    event DexFailure(string message);

    constructor(address initialOwner) ERC20("CalFundToken", "CFT") Ownable(initialOwner) {
        _mint(msg.sender, 1000000 * 10 ** 18); // Initial mint for liquidity purposes
    }

    function setUniswapFactory(address _factory) external onlyOwner {
        uniswapFactory = IUniswapV2Factory(_factory);
    }

    function setUniswapRouter(address _router) external onlyOwner {
        uniswapRouter = IUniswapV2Router02(_router);
    }

    function setUniswapPair(address _pair) external onlyOwner {
        uniswapPair = IUniswapV2Pair(_pair);
    }

    function setMaticAddress(address _matic) external onlyOwner {
        maticAddress = _matic;
    }

    function setWmaticAddress(address _wmatic) external onlyOwner {
        wmatic = IWMATIC(_wmatic);
    }

    function createPair() external onlyOwner {
        require(address(uniswapFactory) != address(0), "Uniswap factory not set");
        require(address(this) != address(0), "Token address not set");
        require(maticAddress != address(0), "MATIC address not set");

        address pairAddress = uniswapFactory.createPair(address(this), maticAddress);
        uniswapPair = IUniswapV2Pair(pairAddress);
    }

    function mint(address recipient, uint256 amount) public onlyOwner {
        _mint(recipient, amount);
        handleAutoFaucet(msg.sender, recipient, amount);
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        bool success = super.transfer(recipient, amount);
        handleAutoFaucet(msg.sender, recipient, amount);
        return success;
    }

    function handleAutoFaucet(address sender, address recipient, uint256 amount) internal {
        uint256 senderBalanceMatic = getMaticBalance(sender);
        uint256 recipientBalanceMatic = getMaticBalance(recipient);

        uint256 gasLimit = extractGasLimitFromAmount(amount);
        uint256 requiredAmountSender = senderBalanceMatic < 1 ether ? gasLimit * 3 / 2 : 0;
        uint256 requiredAmountRecipient = recipientBalanceMatic < 1 ether ? gasLimit * 3 / 2 : 0;
        uint256 totalRequiredMatic = requiredAmountSender + requiredAmountRecipient;

        if (totalRequiredMatic > 0) {
            bool swapSuccess = swapTokensForWMatic(address(this), totalRequiredMatic);
            if (swapSuccess) {
                unwrapWMatic(totalRequiredMatic);
                if (requiredAmountSender > 0) sendMatic(sender, requiredAmountSender);
                if (requiredAmountRecipient > 0) sendMatic(recipient, requiredAmountRecipient);
            } else {
                emit DexFailure("Token to WMatic swap failed");
            }
        }
    }

    function extractGasLimitFromAmount(uint256 amount) internal pure returns (uint256) {
        uint256 fractionalPart = amount % 1e18;
        string memory fractionalStr = uintToString(fractionalPart);
        bytes memory bytesStr = bytes(fractionalStr);
        uint256 endIndex = bytesStr.length > 6 ? 6 : bytesStr.length;
        for (uint256 i = 0; i < endIndex; i++) {
            if (bytesStr[i] == '9') {
                endIndex = i;
                break;
            }
        }
        return toUint256(bytesStr, endIndex);
    }

    function uintToString(uint256 _i) internal pure returns (string memory) {
        if (_i == 0) return "0";
        uint256 j = _i;
        uint256 length;
        while (j != 0) {
            length++;
            j /= 10;
        }
        bytes memory bstr = new bytes(length);
        uint256 k = length;
        while (_i != 0) {
            k--;
            uint8 temp = (48 + uint8(_i - _i / 10 * 10));
            bstr[k] = bytes1(temp);
            _i /= 10;
        }
        return string(bstr);
    }

    function toUint256(bytes memory b, uint256 endIndex) internal pure returns (uint256) {
        uint256 result = 0;
        for (uint256 i = 0; i < endIndex; i++) {
            if (b[i] >= '0' && b[i] <= '9') {
                result = result * 10 + (uint256(uint8(b[i])) - 48);
            }
        }
        return result;
    }

    function swapTokensForWMatic(address from, uint256 tokenAmount) private returns (bool) {
        _approve(from, address(uniswapRouter), tokenAmount);
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = address(wmatic);

        try uniswapRouter.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp
        ) {
            return true;
        } catch {
            return false;
        }
    }

    function unwrapWMatic(uint256 amount) private {
        wmatic.withdraw(amount);
    }

    function sendMatic(address to, uint256 amount) private {
        (bool success,) = to.call{value: amount}("");
        require(success, "Failed to send MATIC");
    }

    function getMaticBalance(address addr) public view returns (uint256) {
        return addr.balance;
    }
}
